SELECT object_construct('x', "CENTER", 'y', "COUNT(BUCKET-IDX)") FROM ( SELECT  *  FROM ( SELECT "CENTER", count("bucket-idx") AS "COUNT(BUCKET-IDX)" FROM ( SELECT *, ((("bucket-idx" * 20.0 :: FLOAT) + 10.0 :: FLOAT) + 0.0 :: FLOAT) AS "CENTER" FROM ( SELECT *, floor(("truncated-value" / 20.0 :: FLOAT)) AS "bucket-idx" FROM ( SELECT *, iff(("PT" < 0.0 :: FLOAT), (0.0 :: FLOAT - 10.0 :: FLOAT), iff(("PT" > 2000.0 :: FLOAT), (2000.0 :: FLOAT + 10.0 :: FLOAT), ("PT" - 0.0 :: FLOAT))) AS "truncated-value" FROM ( SELECT * FROM ( SELECT "PT" FROM ( SELECT  *  FROM ( SELECT "EV", count("JETVAR") AS "COUNT(JETVAR)", any_value("PT") AS "PT" FROM ( SELECT *, MET['pt'] AS "PT" FROM ( SELECT *, event AS "EV" FROM ( SELECT * FROM ( SELECT  *  FROM ( SELECT "RUN", "LUMINOSITYBLOCK", "EVENT", "HLT", "PV", "MET", "MUON", "ELECTRON", "TAU", "PHOTON", "JET", "INDEX" AS "JETVAR_INDEX", "JETVAR" FROM ( SELECT "RUN", "LUMINOSITYBLOCK", "EVENT", "HLT", "PV", "MET", "MUON", "ELECTRON", "TAU", "PHOTON", "JET", "INDEX", "VALUE" AS "JETVAR" FROM ( SELECT "RUN", "LUMINOSITYBLOCK", "EVENT", "HLT", "PV", "MET", "MUON", "ELECTRON", "TAU", "PHOTON", "JET", "INDEX", "VALUE" FROM ( SELECT  *  FROM ( SELECT  *  FROM (adl)),  LATERAL  FLATTEN ( INPUT  => Jet,  PATH  => '',  OUTER  => false,  RECURSIVE  => false,  MODE  => 'ARRAY'))))) WHERE ("JETVAR"['pt'] > 40:: INTEGER))))) GROUP BY "EV") WHERE ("COUNT(JETVAR)" > 1:: INTEGER))))))) GROUP BY "CENTER") ORDER BY "CENTER" ASC NULLS FIRST);